Provozování:
a) doplňkového penzijního spoření, tzn. shromažďovaní příspěvků účastníků, příspěvku zaměstnavatele a státních příspěvků za účelem jejich umísťování do účastnických fondů, obhospodařování majetku v účastnických fondech a vyplácení dávek doplňkového penzij
ního  spoření;
b) penzijního připojištění prostřednictvím transformovaného fondu, tzn. shromažďovaní peněžních prostředků od účastníků penzijního připojištění a státu, poskytnutých ve prospěch těchto účastníků, obhospodařování majetku v transformovaném fondu a vyplácení
 dávek penzijního připojištění, jednak pro účastníky penzijního připojištění a jednak pro příjemce dávek, vůči nimž byly závazky vyčleněny do transformovaného fondu;
c) činnosti související se zajištěním provozu penzijní společnosti nebo jiných penzijních společností nebo jiných finančních institucí.
